def known_plural(word):
    lword = word.lower()
    return lword in plural_of.values() or\
        lword in singular_of.keys() or\
        lword in past_of.values() or\
        lword in pres_part_of.values() or\
        lword in past_part_of.values()

def known_singular(word):
    lword = word.lower()
    return lword in singular_of.values() or\
        lword in plural_of.keys() or\
        lword in past_of.values() or\
        lword in pres_part_of.values() or\
        lword in past_part_of.values()

def known_past(word):
    return word.lower() in past_of.values()

def known_past_part(word):
    return word.lower() in past_part_of.values()

def known_pres_part(word):
    return word.lower() in pres_part_of.values()

def convert_to_plural(word):
    if word in plural_of:
        return plural_of[word]
    if word.lower() in plural_of:
        return plural_of[word.lower()]
    if known_plural(word):
        return word
    for rule in plural_convert_rules:
        match = rule.match(word)
        if match:
            return plural_convert_rules[rule](match)
    return None

def convert_to_singular(word):
    if word in singular_of:
        return singular_of[word]
    if word.lower() in singular_of:
        return singular_of[word.lower()]
    for rule in singular_convert_rules:
        match = rule.match(word)
        if match:
            return singular_convert_rules[rule](match)
    return None

def convert_to_past(word):
    if word in past_of:
        return past_of[word]
    if word.lower() in past_of:
        return past_of[word.lower()]
    for rule in past_convert_rules:
        match = rule.match(word)
        if match:
            return past_convert_rules[rule](match)
    return None

def convert_to_pres_part(word):
    if word in pres_part_of:
        return pres_part_of[word]
    if word.lower() in pres_part_of:
        return pres_part_of[word.lower()]
    for rule in pres_part_convert_rules:
        match = rule.match(word)
        if match:
            return pres_part_convert_rules[rule](match)
    return None

def convert_to_past_part(word):
    if word in past_part_of:
        return past_part_of[word]
    if word.lower() in past_part_of:
        return past_part_of[word.lower()]
    for rule in past_part_convert_rules:
        match = rule.match(word)
        if match:
            return past_part_convert_rules[rule](match)
    return None

def is_plural(word):
    if known_plural(word):
        return True
    if known_singular(word):
        return False
    for rule in plural_recognize_rules:
        if rule.match(word):
            return True
    return False

def is_singular(word):
    if known_singular(word):
        return True
    if known_plural(word):
        return False
    for rule in singular_recognize_rules:
        if rule.match(word):
            return True
    return not is_plural(word)

def is_past(word):
    if known_past(word):
        return True
    for rule in past_recognize_rules:
        if rule.match(word):
            return True
    return False

def is_pres_part(word):
    if known_pres_part(word):
        return True
    for rule in pres_part_recognize_rules:
        if rule.match(word):
            return True
    return False

def is_past_part(word):
    if known_past_part(word):
        return True
    for rule in past_part_recognize_rules:
        if rule.match(word):
            return True
    return False
